import React from "react";

import "./WritePost.css";

const WritePost = () => {
  return (
    <form action="POST" className="writePostForm">
      <input
        type="text"
        name="postTitle"
        className="postArticle postTitle"
        placeholder="제목"
      />
      <input
        type="text"
        name="postContent"
        className="postArticle postContent"
        id=""
        placeholder="내용"
      />
      <button type="submit" className="sendPostForm">
        글쓰기
      </button>
    </form>
  );
};

export default WritePost;
